import fetch from 'isomorphic-fetch';
var apiDomain = process.env.API_DOMAIN;
var apiPrefix = process.env.API_PREFIX;
export function postContact(body) {
  return fetch("".concat(apiDomain).concat(apiPrefix, "/contact"), {
    method: 'POST',
    headers: {
      'Accept': 'application/json',
      "Content-Type": "application/x-www-form-urlencoded"
    },
    cache: 'default',
    mode: 'cors',
    body: body
  }).then(function (resp) {
    return resp.json();
  });
}
